import React, { useState } from 'react';
import { CopyToClipboard } from 'react-copy-to-clipboard';
import channelService from '../../service/channelService';
import Chat from './Container/Chat/Chat';

const Channel = ({
  channel, users, name, messages, emitSendMessage, emitDeleteMessage,
}) => {
  const createInvite = async (e) => {
    e.preventDefault();
    const inviteLink = await channelService.getInvite(channel);
    console.log(inviteLink)
    return inviteLink;
  };

  console.log(createInvite);
  return (
    <div>
      {name}
      <button type="button" onClick={createInvite}>Create Invite Link</button>
      {/* <CopyToClipboard
        text={'sadas'}
      >
        <button type="button">Copy to clipboard</button>
      </CopyToClipboard> */}
      <Chat
        messages={messages}
        emitSendMessage={emitSendMessage}
        emitDeleteMessage={emitDeleteMessage}
        channel={channel}
      />
    </div>
  );
};

export default Channel;
